import './Nav.css';
import logo from '../../logo.png'

function Nav() {
    return (
      <div id="Nav-container">
        <div id="Nav-wrapper">
            <div id="Nav-logo-wrapper">
                <img src={logo} />
            </div>
        </div>
      </div>
    );
  }

export default Nav;
